        .overlay_loading_screen {

        @keyframes lds-ripple {
            0% {
                top: 96px;
                left: 96px;
                width: 0;
                height: 0;
                opacity: 1;
            }

            100% {
                top: 38px;
                left: 38px;
                width: 116px;
                height: 116px;
                opacity: 0;
            }
        }

        @-webkit-keyframes lds-ripple {
            0% {
                top: 96px;
                left: 96px;
                width: 0;
                height: 0;
                opacity: 1;

            100% {

        /* .lds-ripple {
    position: relative;
  } */
        .lds-ripple div {
            box-sizing: content-box;
            position: absolute;
            border-width: 4px;
            border-style: solid;
            /* opacity: 1; */
            border-radius: 50%;
            -webkit-animation: lds-ripple 1s cubic-bezier(0, 0.2, 0.8, 1) infinite;
            animation: lds-ripple 1s cubic-bezier(0, 0.2, 0.8, 1) infinite;
        }

        .lds-ripple div:nth-child(1) {
            border-color: #07a7db;
        }

        .lds-ripple div:nth-child(2) {
            border-color: #3a4191;
            -webkit-animation-delay: -0.5s;
            animation-delay: -0.5s;
        }

        .lds-ripple {
            width: 200px !important;
            height: 180px !important;

    <script>
        var finalarray = [];
        var buffer = "";
        function edValueKeyPress() {
            var edValue = document.getElementById("myInput");
            var inputValue = edValue.value;
            var lblValue = document.getElementById("lblValue");
            if (inputValue) {
                getfiltereddata(inputValue)
            } else {
                getthevalue("")
            }

        }

        function getfiltereddata(inputvalue) {
            $.post('https://yescelebrate.yesbank.in/users/get_all_users_by_search', { search_text: inputvalue }, function (data, status) {
                if (data.status && data.info.users.length > 0) {
                    finalarray = data.info.users.reverse();
                } else {
                    finalarray = [];
                }

                //    console.log("data : "+JSON.stringify(data,null,2))
                getthevalue(finalarray)
            })
        }

        function getthevalue(finalarray) {
            if (finalarray == "") {
                $('#data_lists').css('display', 'none')
            } else {
                $('#data_lists').css('display', 'block')
                // console.log(finalarray);
                buffer = "";

                for (var i = 0; i < finalarray.length; i++) {
                    var item = finalarray[i];
                    console.log(item);
                    
                    // buffer += " <li style='list-style:none' id='" + i + "' onclick='showmeModal(\"" + item.story_id + "\",\"" + item.user_id + "\",\"" +item.full_name + "\",\"" + item.description + "\",\"" + item.email + "\",\"" + item.image + "\",\"" + item.phone_number + "\")'>" + item.full_name + "</li>";

                    buffer += " <li style='list-style:none' id='" + i + "' onclick=\"showmeModal('"+item.story_id+"','"+item.user_id+"','"+item.full_name+"','"+escape(item.description)+"','"+item.email+"','"+item.image+"','"+item.phone_number+"')\">" + item.full_name + "</li>";
                }
                $('ul').html(buffer);
            }

        }

        getthevalue("");

        function showmeModal(story_id, user_id, fullname, description, email, image, phone_number) {
            console.log("fullname : " + fullname)
            console.log("description : " + unescape(description));
            console.log("email : " + email)
            console.log("image : " + image)
            console.log("phone_number : " + phone_number);
            document.getElementById('fullname').innerHTML = fullname;
            document.getElementById('description').innerHTML = unescape(description);
            // document.getElementById('email').innerHTML = email;
            var whatsappurl = "https://api.whatsapp.com/send?text=Yescelebrate YESBANK message : " + 'https://yescelebrate.yesbank.in/share/' + story_id;
            $("#whatsappsharingsearch").attr('href', whatsappurl);

            var facebookurl = 'https://www.facebook.com/sharer/sharer.php?u=' + 'https://yescelebrate.yesbank.in/share/' + story_id;
            $("#facebook_url_search").attr('href', facebookurl);

            
            $("#image").attr('src', "https://yescelebrate.yesbank.in/story_images/" + image);
            // document.getElementById('image').innerHTML = "http://192.168.0.211:8000/story_images/"+image;
            // document.getElementById('phone_number').innerHTML = phone_number;
            $('#searchModal').modal("show")
        }


        $(document).on("click", function () {
            $("#data_lists").css('display', 'none')
        });



    </script>

        function clickableGrid(rows, cols, callback) {
            var i = 0;
            var grid = document.createElement('table');
            grid.className = 'grid';
            for (var r = 0; r < rows; ++r) {
                var tr = grid.appendChild(document.createElement('tr'));
                for (var c = 0; c < cols; ++c) {
                    var cell = tr.appendChild(document.createElement('td'));
                    // document.createElement('td').style.width = "100px"
                    // cell.innerHTML = ++i;
                    cell.setAttribute('id', i++);
                    cell.addEventListener('click', (function (el, r, c, i) {
                        return function () {
                            callback(el, r, c, i);
                        }
                    })(cell, r, c, i), false);
                }
            }
            return grid;
        }

    <script>
        var counter;
        function setZoom(zoom, el) {

            transformOrigin = [0, 0];
            el = el || instance.getContainer();
            var p = ["webkit", "moz", "ms", "o"],
                s = "scale(" + zoom + ")",
                oString = (transformOrigin[0] * 100) + "% " + (transformOrigin[1] * 100) + "%";

            for (var i = 0; i < p.length; i++) {
                el.style[p[i] + "Transform"] = s;
                el.style[p[i] + "TransformOrigin"] = oString;
            }

            el.style["transform"] = s;
            el.style["transformOrigin"] = oString;

        }

        function showVal(a) {
            counter = a
            var zoomScale = Number(a) / 30;
            setZoom(zoomScale, document.getElementsByClassName('maindiv')[0])
        }

               var zoomScale = Number(counter) / 30;

           }else{
            console.log("no more increase : "+counter) 
           }
        }

               var zoomScale = Number(counter) / 30;
